// IMPORT REACT
import React from "react";

// ADDITIONAL IMPORTS
import { Link } from "react-router-dom";

// CREATE COMPONENT
const Navbar = () => {
  return (
    <nav>
      <Link to="/orders">Order History</Link>
    </nav>
  );
};

// EXPORT COMPONENT
export default Navbar;
